import React, { useEffect, useState } from 'react';
import AIVisual from './components/AIVisual';
import './styles/globals.css';

function App() {
  const [scrollY, setScrollY] = useState(0);
  const [mousePosition, setMousePosition] = useState({ x: 0, y: 0 });

  // Handle scroll and mouse movement effects
  useEffect(() => {
    const handleScroll = () => setScrollY(window.scrollY);
    const handleMouseMove = (e) => {
      setMousePosition({ x: e.clientX, y: e.clientY });
    };

    window.addEventListener('scroll', handleScroll);
    window.addEventListener('mousemove', handleMouseMove);

    return () => {
      window.removeEventListener('scroll', handleScroll);
      window.removeEventListener('mousemove', handleMouseMove);
    };
  }, []);

  return (
    <div style={{
      background: 'linear-gradient(130deg, #00040F 60%, #001F3F 100%)',
      color: '#FFFFFF',
      minHeight: '100vh',
      overflow: 'hidden',
      position: 'relative',
    }}>
      {/* Interactive Background Elements */}
      {[...Array(5)].map((_, i) => (
        <div
          key={`orb-${i}`}
          style={{
            position: 'absolute',
            width: `${100 + i * 50}px`,
            height: `${100 + i * 50}px`,
            left: `${20 + i * 15}%`,
            top: `${10 + i * 20}%`,
            background: 'radial-gradient(circle, rgba(92, 225, 230, 0.15) 0%, rgba(92, 225, 230, 0) 70%)',
            borderRadius: '50%',
            filter: 'blur(40px)',
            transform: `translate(
              ${(mousePosition.x - window.innerWidth / 2) / (20 + i * 5)}px,
              ${(mousePosition.y - window.innerHeight / 2) / (20 + i * 5)}px
            )`,
            transition: 'transform 0.3s ease-out',
            zIndex: 0,
          }}
        />
      ))}

      {/* Animated Grid Background */}
      <div style={{
        position: 'absolute',
        top: 0,
        left: 0,
        right: 0,
        bottom: 0,
        backgroundImage: `
          linear-gradient(rgba(92, 225, 230, 0.1) 1px, transparent 1px),
          linear-gradient(90deg, rgba(92, 225, 230, 0.1) 1px, transparent 1px)
        `,
        backgroundSize: '40px 40px',
        opacity: 0.3,
        transform: `translateY(${scrollY * 0.2}px)`,
        zIndex: 0,
      }} />

      <nav style={{
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        padding: '20px 40px',
        maxWidth: '1400px',
        margin: '0 auto',
        backgroundColor: 'rgba(0, 4, 15, 0.8)',
        backdropFilter: 'blur(8px)',
        zIndex: 10,
        position: 'relative',
        transform: `translateY(${scrollY * 0.1}px)`,
        opacity: Math.max(1 - scrollY / 500, 0.8),
      }}>
        <div style={{ 
          fontSize: '24px', 
          fontWeight: 'bold',
          display: 'flex',
          alignItems: 'center',
          gap: '8px',
        }}>
          <span style={{
            color: '#61DAFB',
            fontSize: '28px',
          }}>KP</span>
          AI Research
        </div>
        <div style={{
          display: 'flex',
          gap: '40px',
        }}>
          <a href="#about" style={{ color: '#FFFFFF', textDecoration: 'none' }}>About</a>
          <a href="#research" style={{ color: '#FFFFFF', textDecoration: 'none' }}>Research</a>
          <a href="#projects" style={{ color: '#FFFFFF', textDecoration: 'none' }}>Projects</a>
          <a href="#contact" style={{ color: '#FFFFFF', textDecoration: 'none' }}>Contact</a>
        </div>
      </nav>

      <main style={{
        maxWidth: '1400px',
        margin: '60px auto',
        padding: '0 40px',
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        position: 'relative',
        zIndex: 1,
      }}>
        <div style={{ 
          maxWidth: '600px',
          transform: `translateY(${-scrollY * 0.2}px)`,
          opacity: Math.max(1 - scrollY / 700, 0),
        }}>
          <div className="animate-slide-down" style={{
            backgroundColor: 'rgba(92, 225, 230, 0.1)',
            padding: '8px 16px',
            borderRadius: '20px',
            display: 'inline-block',
            marginBottom: '24px',
            border: '1px solid rgba(92, 225, 230, 0.2)',
            backdropFilter: 'blur(4px)',
            animation: 'slideDown 0.8s ease-out',
          }}>
            <span style={{ color: '#5CE1E6' }}>📊 Data Science Student</span>
          </div>

          <h1 className="animate-slide-up" style={{
            fontSize: '72px',
            lineHeight: '1.1',
            marginBottom: '24px',
            animation: 'slideUp 0.8s ease-out',
          }}>
            The Next
            <br />
            <span className="gradient-text">Generation</span>
            <br />
            Data Scientist.
          </h1>

          <p className="animate-fade-in" style={{
            color: 'rgba(255, 255, 255, 0.7)',
            fontSize: '18px',
            lineHeight: '1.6',
            marginBottom: '40px',
            maxWidth: '470px',
            animation: 'fadeIn 1s ease-out',
          }}>
            Passionate about machine learning, statistical analysis, and data visualization.
            Focused on extracting meaningful insights from complex datasets.
          </p>

          <div className="animate-slide-up" style={{
            display: 'flex',
            gap: '20px',
            animation: 'slideUp 0.8s ease-out 0.2s backwards',
          }}>
            <a href="#projects" className="button-glow">View Projects</a>
            <a href="#analysis" className="button-outline">See Analysis</a>
          </div>
        </div>

        <div style={{
          transform: `translate(
            ${(mousePosition.x - window.innerWidth / 2) / 30}px,
            ${(mousePosition.y - window.innerHeight / 2) / 30}px
          )`,
          transition: 'transform 0.1s ease-out',
        }}>
          <AIVisual />
        </div>
      </main>
    </div>
  );
}

export default App;
